import React from "react";
import logo from "./logo.svg";
import "./App.css";

function App() {
  class AnimalInfo {
    public age = 10;
    public setAge(age: number) {
      this.age = age;
    }
  }
  interface animal extends AnimalInfo {
    getFood(): string;
  }
  const panda: animal = {
    age: 20,
    getFood: () => {
      return "bamboo";
    },
    setAge: (age: number) => {},
  };
  return <div className="App">11</div>;
}

export default App;
